/* Define the Merriweather font-face */
@font-face {
    font-family: 'Merriweather';
    font-style: normal;
    font-weight: 400;
    src: url('https://fonts.gstatic.com/s/merriweather/v30/u-440qyriQwlOrhSvowK_l5Oey0.woff2') format('woff2');
}

@font-face {
    font-family: 'Merriweather';
    font-style: normal;
    font-weight: 700;
    src: url('https://fonts.gstatic.com/s/merriweather/v30/u-4n0qyriQwlOrhSvowK_l5OeXwWtfHFrXo.woff2') format('woff2');
}

/* Apply Merriweather font to all elements */
* {
    font-family: 'Merriweather', serif !important;
}
